actionConfiguration.body:
() => {
  let data = [];
  for (let i = 0; i < GET_DATA.data.length; i++) {
    if (GET_DATA.data[i].SCHEDULE_DATE <= DATE.date_format()) {
      if (GET_DATA.data[i].REMARK == "CALL BACK" && GET_DATA.data[i].ACTIVE == true) {
        data.push(GET_DATA.data[i]);
      }
    }
  }
  data.sort((a, b) => {
    return b.SCHEDULE_DATE - a.SCHEDULE_DATE;
  });
  return data;
}

